const axios = require("axios");

const Home = () =>{

	const getStatus = (e) =>{
		e.preventDefault()

		axios.get('curl https://kctbh9vrtdwd.statuspage.io/api/v2/status.json')
		.then(res => console.log(res))
		.catch(err => console.log(err))
	}
	return(
		<div>
			<h1>status github</h1>
			<button onClick={getStatus}>get status</button>
		</div>
		)
}

export default Home;
